import React from 'react'

function SellerCard( {seller} ) {

    const tempCardStyle = {
        margin: '5px',
        textAlign: 'center',
        padding: '5px',
        float: 'left',
    }


    let imgSrcLink;

    if (seller.image !== null) {
        imgSrcLink = seller.image.medium
        }
    else {
        imgSrcLink = "https://www.wolflair.com/wp-content/uploads/2017/01/placeholder.jpg";
        }

    return (
        <div className="ui card" style={tempCardStyle}> 
            <div className="image">
            <img src={imgSrcLink} className="ui small centered image" alt={seller.name}/>
            </div>
            <div className="content">
                <div className="header">{seller.name}</div>
                <div className="meta"><span>See {seller.name.split(' ', 1)}'s products here</span></div>

            </div>
        {/* <h3 className="ui header">{seller.name}</h3>
        <h5>See {seller.name.split(' ', 1)}'s products here</h5> */}
        </div>
    )
}

export default SellerCard






